import { useEffect, useRef } from 'react';
import {
  Backdrop,
  Button,
  CircularProgress,
  Container,
  Grid,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Typography,
} from '@mui/material';
import Page from 'components/Page';
import useAxios from 'hooks/useAxios';
import axios from 'apis/';

import { useLocation } from 'react-router';
import { getBOBCurrency } from 'utils/dataHandler';
import Fieldset from 'components/forms/Fieldset';
import jsPDFInvoiceTemplate, { JSPDF, OutputType } from 'utils/reporteNotaVenta';

export default function DetalleVentas() {
  const location = useLocation();
  const [resGet, , loadingGet, axiosFetchGet] = useAxios();
  const id = location.pathname.split('/').pop();
  const dataPDF = useRef();

  useEffect(() => {
    if (Array.isArray(resGet)) return;

    dataPDF.current = {
      outputType: OutputType.Save,
      jsPDFDocObject: JSPDF,
      returnJsPDFDocObject: true,
      fileName: `${resGet.socio.apellidoP} ${new Date(resGet.fecha).toLocaleDateString()}.pdf`,
      orientationLandscape: false,
      compress: true,

      logo: {
        src: 'data:image/png;base64,',
        type: 'PNG', // optional, when src= data:uri (nodejs case)
        width: 53.33, // aspect ratio = width/height
        height: 26.66,
        margin: {
          top: 0, // negative or positive num, from the current position
          left: 0, // negative or positive num, from the current position
        },
      },
      stamp: {
        inAllPages: false, // by default = false, just in the last page
        // src: 'https://raw.githubusercontent.com/edisonneza/jspdf-invoice-template/demo/images/qr_code.jpg',
        type: 'JPG', // optional, when src= data:uri (nodejs case)
        width: 20, // aspect ratio = width/height
        height: 20,
        margin: {
          top: 0, // negative or positive num, from the current position
          left: 0, // negative or positive num, from the current position
        },
      },
      business: {
        name: 'Gimnacio',
        address: 'Albania, Tirane ish-Dogana, Durres 2001',
        phone: '719164849',
        email: 'gym@gmail.com',
        website: 'www.example.al',
      },
      contact: {
        label: 'Nota de venta emitida para:',
        name: `${resGet.socio.nombre} ${resGet.socio.apellidoP} ${resGet.socio.apellidoM}`,
        address: resGet.socio.direccion,
      },
      invoice: {
        label: 'Codigo de venta #: ',
        num: resGet.id,
        invDate: `Fecha de venta: ${new Date(resGet.fecha).toLocaleDateString()}`,
        invGenDate: `Fecha de la nota de venta: ${new Date().toLocaleDateString()}`,
        headerBorder: false,
        tableBodyBorder: false,
        header: [
          {
            title: '#',
            style: {
              width: 10,
            },
          },
          {
            title: 'Productos',
            style: {
              width: 80,
            },
          },
          { title: 'Cantidad' },
          { title: 'Precio uni.' },
          { title: 'Subtotal' },
        ],
        table: resGet.detalle.map(({ cantidad, precioAdquirido, productos }, index) => [
          index + 1,
          productos.nombre,
          cantidad,
          getBOBCurrency(precioAdquirido),
          getBOBCurrency(precioAdquirido * cantidad),
        ]),
        additionalRows: [
          {
            col1: 'Total:',
            col2: getBOBCurrency(
              resGet.detalle.reduce((prev, current) => prev + current.precioAdquirido * current.cantidad, 0)
            ),
          },
        ],
      },
    };
  }, [resGet]);

  useEffect(() => {
    axiosFetchGet({
      axiosInstance: axios,
      method: 'GET',
      url: `/api/v1/ventas/${id}`,
    });
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);

  return (
    <Page title="Detalle ventas" sx={{ position: 'relative' }}>
      <Backdrop sx={{ color: '#fff', zIndex: (theme) => theme.zIndex.drawer }} open={loadingGet}>
        <CircularProgress color="inherit" />
      </Backdrop>
      <Container>
        <Typography variant="h3" component="h1" paragraph>
          Detalle de venta
        </Typography>
        <Typography gutterBottom sx={{ paddingBottom: '2rem' }}>
          Muestra el detalle de la venta
        </Typography>

        {!Array.isArray(resGet) && (
          <>
            <Button variant="outlined" onClick={() => jsPDFInvoiceTemplate(dataPDF.current)}>
              Descargar nota de venta
            </Button>
            <Fieldset title="Datos de la venta">
              <Grid container wrap="wrap">
                <Grid item xs={12} sm={6}>
                  <Typography component="h3" paragraph>
                    <span style={{ fontWeight: '600' }}>Código de venta:</span>
                    {` ${resGet.id}`}
                  </Typography>
                </Grid>
                <Grid item xs={12} sm={6}>
                  <Typography component="h3" paragraph>
                    <span style={{ fontWeight: '600' }}>Fecha:</span>
                    {` ${new Date(resGet.fecha).toLocaleDateString()}`}
                  </Typography>
                </Grid>
                <Grid item xs={12} sm={6}>
                  <Typography component="h3" paragraph>
                    <span style={{ fontWeight: '600' }}>Cliente:</span>
                    {` ${resGet.socio.nombre} ${resGet.socio.apellidoP} ${resGet.socio.apellidoM}`}
                  </Typography>
                </Grid>
                <Grid item xs={12} sm={6}>
                  <Typography component="h3" paragraph>
                    <span style={{ fontWeight: '600' }}>Vendedor:</span>
                    {` ${resGet.vendedor.nombre} ${resGet.vendedor.apellidoP} ${resGet.vendedor.apellidoM} `}
                  </Typography>
                </Grid>
              </Grid>
              <TableContainer>
                <Table>
                  <TableHead>
                    <TableRow>
                      <TableCell>PRODUCTO</TableCell>
                      <TableCell align="center">CANTIDAD</TableCell>
                      <TableCell align="center">PRECIO UNITARIO</TableCell>
                      <TableCell align="center">SUBTOTAL</TableCell>
                    </TableRow>
                  </TableHead>
                  {!Array.isArray(resGet) && (
                    <TableBody>
                      {resGet.detalle.map(({ productos, cantidad, precioAdquirido }, index) => (
                        <TableRow key={index} sx={{ '&:last-child td, &:last-child th': { border: 0 } }}>
                          <TableCell component="th" scope="row">
                            {productos.nombre}
                          </TableCell>
                          <TableCell align="center">{cantidad}</TableCell>
                          <TableCell align="center">{getBOBCurrency(precioAdquirido)}</TableCell>
                          <TableCell align="center">{getBOBCurrency(precioAdquirido * cantidad)}</TableCell>
                        </TableRow>
                      ))}
                      <TableRow>
                        <TableCell colSpan={2} sx={{ borderBottom: 'none' }} />
                        <TableCell align="center" sx={{ fontWeight: '700' }}>
                          TOTAL
                        </TableCell>
                        <TableCell align="center">
                          {getBOBCurrency(
                            resGet.detalle.reduce(
                              (prev, current) => prev + current.precioAdquirido * current.cantidad,
                              0
                            )
                          )}
                        </TableCell>
                      </TableRow>
                    </TableBody>
                  )}
                </Table>
              </TableContainer>
            </Fieldset>
          </>
        )}
      </Container>
    </Page>
  );
}
